import react from 'react';
import './App.css';

import Maps from './maps.js';

import Logo from './logo.js';

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';

function Frame(){

    return(
        <div>
        <Router>
        <div id="user">
          <Link to="/account">회원가입</Link>
          <span>/</span>
          <Link to="/login">로그인</Link>
        </div>
          <Routes>
            <Route path="/account" element={<Maps/>}/>
            <Route path="/login" elemtent={<Maps/>}/>
          </Routes>
        </Router>
        <div id="menu">
            <a href="./">
              <Logo/>
            </a>
          <nav id ="mainNav">
            <ul className = "horizontal-list">
              <li><a href="/sogae.html">서비스 소개 ⌄ </a></li>
              <li><a href="/update.html">데이터 업로드 ⌄ </a></li>
              <li><a href="/community.html">커뮤니티 ⌄ </a></li>
            </ul>
          </nav>
        </div>
        </div>
    );
}


export default Frame;
